CREATE TABLE G5_CENTRO_EDUCACAO_INFANTIL(
  id_cei              INTEGER  NOT NULL,
  regional            VARCHAR(16) NOT NULL,
  modalidade          VARCHAR(17) NOT NULL,
  dependencia_adm VARCHAR(17) NOT NULL,
  nome_cei            VARCHAR(50) NOT NULL,
  rua                 VARCHAR(48) NOT NULL,
  numero              INTEGER  NOT NULL,
  bairro              VARCHAR(29) NOT NULL,
  id_bairro           INTEGER  NOT NULL,
  PRIMARY KEY (id_cei),
  FOREIGN KEY (id_bairro) REFERENCES G5_BAIRRO_CIDADE
);
